E_D("replace into `qb_reply` values('720','','0','686','52','1','0','<p>单列圆柱滚子轴承一般只用于承受较大的径向载荷，由于其滚子与套圈滚道为线接触，因此，与相同尺寸的向心球轴承相比，其径向载荷能力较大（提高1.5～3倍），耐冲击、刚性好，但一般不用于承受轴向载荷。<br />单列圆柱滚子轴承要求与其配合的轴和外壳孔的加工精度较高，安装时不允许内圈轴线与外圈轴线相互倾斜，因两轴线倾斜时，将使滚子与套圈接触不均匀，引起应力集中，严重影响轴承的载荷能力，大大降低轴承的使用寿命。当内、外圈滚道或滚子母线带有一定凸度时，可以有效降低滚子与滚道接触的边缘效应，提高轴承寿命。<br />圆柱滚子轴承不能限制轴（外壳）的轴向位移，若需轴向限位时，往往需要与其它类型轴承（如深沟球轴承）配合使用，此类轴承一般只用于承受径向载荷，只有内、外圈均带挡边的单列轴承可承受一定的轴向载荷。<br />圆柱滚子轴承一般不允许轴相对外壳孔倾斜。但是，在轻载荷条件下，单列圆柱滚子轴承允许内、外圈轴线相互倾斜2′，如果载荷较大，允许误差可稍大，但不得超过4′。<br />单列圆柱滚子轴承主要用于大型电机、机床主轴、车轴轴箱、柴油机曲轴以及汽车、拖拉机的变速箱等。<br /><a href=\"http://www.sbi.com.cn/userfiles/NU.JPG\" target=\"_blank\"><img style=\"width:180px;float:none;height:269px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/NU.JPG\" width=\"180\" height=\"269\" /></a><a href=\"http://www.sbi.com.cn/userfiles/NJ.JPG\" target=\"_blank\"><img style=\"width:180px;float:none;height:273px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/NJ.JPG\" width=\"180\" height=\"273\" /></a><a href=\"http://www.sbi.com.cn/userfiles/N.JPG\" target=\"_blank\"><img style=\"width:180px;float:none;height:247px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/N.JPG\" width=\"180\" height=\"247\" /></a></p><p>&nbsp;</p><table style=\"width:479px;border-collapse:collapse\" width=\"479\" height=\"665\"><colgroup><col width=\"41\" /><col width=\"30\" /><col width=\"17\" /><col width=\"17\" /><col width=\"13\" /><col width=\"17\" /><col width=\"39\" /><col width=\"45\" /><col width=\"29\" /><col width=\"23\" /><col width=\"29\" /><col width=\"34\" /><col width=\"46\" /><col width=\"47\" /><col width=\"52\" /><tbody><tr height=\"50\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:41px;white-space:normal;background:#ffffff;height:95px;color:#000000;font-size:11px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et4\" height=